import React, { Component } from 'react';
import * as api from '../utils/axiosRequests';

class NavBar extends Component {
  state = { topics: [] };

  componentDidMount() {
    api.getTopics().then(topics => {
      this.setState({ topics: topics });
    });
  }

  render() {
    return <div></div>;
  }
}

export default NavBar;
